INSERT INTO `curso` (`idcurso`, `titulo`, `portada`, `url_video_intro`, `url_portada_det`, `plan`, `hora_duracion`, `total_clases`, `precio`, `idcategoria`, `descripcion`, `descripcion_larga`, `fecha_inicio`, `fecha_final`, `cetificado`, `nom_certificado`, `recursos`, `modalidad`, `plataforma`, `brochure`, `estado`, `created_at`, `updated_at`) VALUES
(14, 'Especialización en Formulación de Proyectos de Innovación', '1611766493.png', 'https://youtu.be/huEKCczWJm8', 'frm-portada.jpg', 'pago', 320, 40, 300.00, 2, 'Las clases serán 100% virtuales, con 02 sesiones por semana. Con la especialización los participantes multiplicaran sus capacidades en formulación de proyectos de Innovación.', 'CAMPUS VITUAL E- LEARNING. Los participantes del curso tendrán a su disposición nuestra plataforma virtual, donde podrán interactuar, aprender y compartir contenido, junto a nuestros especialistas con experiencia profesional y amplio conocimiento en su materia.\r\nPLATAFORMA VIRTUAL E-COMERCE. Realiza tu compra rápida y segura a través de nuestra PLATAFORMA SEGURA DE PAGOS ONLINE.\r\nEstamos validados por CULQI y aceptamos todas las tarjetas', '2021-02-13', '2021-06-26', '1', 'Especialista en Identificación y Formulación de Proyectos de Innovación', '1', '1', '1', 'b_form_proyectos.pdf', '1', '2021-01-27 11:54:53', '2021-02-15 11:26:03'),
(15, 'Programa de Especialización en Acuicultura Amazónica', '1611944414.png', 'https://youtu.be/WD1AvA_31PM', 'acui-portada.jpg', 'pago', 320, 40, 300.00, 1, 'La especialización consta de 04 cursos claves en la acuicultura, que se desarrollarán en 40 sesiones.\r\nLas clases serán 100% virtual, 02 sesiones por semana , al finalizar el programa de capacitación se espera que los participantes cuenten con altos niveles de competencia en acuicultura amazónica, con énfasis en sanidad, técnicas de reproducción y tecnologías de producción intensiva.', 'CERTIFICADO: Certificación oficial como “Especialista en Acuicultura Amazónica” a nombre del INSTITUTO DE INVESTIGACIONES DE LA AMAZONÍA PERUANA.\r\nMETODOLOGÍA: Las clases serán 100% virtual, 02 sesiones por semana , al finalizar el programa de capacitación se espera que los participantes\r\ncuenten con altos niveles de competencia en acuicultura amazónica, con énfasis en sanidad, técnicas de reproducción y tecnologías de producción intensiva.\r\nLa especialización consta de 04 cursos claves en la acuicultura, que se desarrollarán en 40 sesiones.', '2021-02-16', '2021-06-30', '1', 'Especialista en Acuicultura Amazónica.', '1', '1', '1', 'b_acui_amazonica.pdf', '1', '2021-01-29 13:20:14', '2021-02-15 11:25:37'),
(16, 'Redacción de artículos científicos para publicación en revistas indexadas', 'prin_1620080758.jpg', NULL, 'frm-portada.jpg', 'gratis', 6, 3, 0.00, 3, 'El participante después del evento, saldrá con conocimientos y criterios elementales en las temáticas de redacción, procesamiento estadístico de los datos y publicación de artículos científicos en revistas nacionales e internacionales indexadas.', 'El curso taller será 100% virtual, durante 3 días; se desarrollará una sesión por día (120 minutos). Con este curso los participantes lograrán ampliar sus conocimientos y capacidad investigativa, sobresaliendo en la redacción y publicación de artículos científicos.', '2021-05-04', '2021-05-06', '2', NULL, '1', '1', '1', NULL, '1', '2021-05-03 17:25:58', '2021-05-03 17:25:58'),
(17, 'Workshop Biología computacional', 'prin_1620919652.jpg', NULL, 'frm-portada.jpg', 'pago', 10, 6, 300.00, 3, 'El participante después del evento, tendrá los conocimientos y habilidades básicas en computación de alto rendimiento, programación en Python, investigación de fármacos asistido por computadoras y simulación de sistemas biológicos para solucionar problemas de interés en salud pública.', 'El workshop será 100% virtual, un módulo por día con una duración de 120 minutos. comprenderá módulos teóricos y prácticas virtuales, tiene como objetivo brindar a los investigadores de las diferentes áreas de la ciencias biológicas, las herramientas y habilidades necesarias en programación en Python, simulación de sistemas biológicos y diseño racional de fármacos, de la mano con el avance de las tecnologías de vanguardia; como el uso de la supercomputadora MANATI del IIAP, que gracias a sus grandes capacidades computacionales puede realizar  cálculos complejos de sistemas biológicos,  que brindan una aproximación más real a las simulaciones por computadora. Por otro lado, la reciente pandemia por COVID-19 pone de manifiesto la necesidad de desarrollar habilidades en bioinformática y biología computacional que en el contexto actual son determinantes para la investigación y solución de problemas en salud pública; como el desarrollo vacunas y sistemas de diagnóstico molecular', '2021-05-31', '2021-06-05', '1', NULL, '1', '1', '1', 'b_computacional.pdf', '1', '2021-05-13 10:27:32', '2021-05-13 10:27:32');
